import React from "react";
let styles = {
  circleStyles: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    margin: "5px",
    width: "40px",
    height: "40px",
    background: "rgb(222, 221, 221)",
    borderRadius: "50%",
  },
  imageStyles: {
    height: "24px",
    width: "24px"
  }
}

class CircularIcon extends React.Component {
  constructor(props) {
    super(props);
  }
  onMouseEnter() {
    styles.circleStyles.background = "rgb(221, 221, 221)";
  }
  onMouseLeave() {
    styles.circleStyles.background = "rgb(81, 81, 81)";
  }
  render(props) {
    return (
      <div style = {styles.circleStyles}>
        <img src = {require("./../images/icons/" + props.type + "Icon.png").default} style = {styles.imageStyles}></img>
      </div>
    )
  }
}

export default CircularIcon;
